import React from "react";
import { useEffect } from "react";
export const RestaurantList = ({ loadRestaurants }) => {
  useEffect(() => {
    loadRestaurants();
  }, [loadRestaurants]);
  return <div>RestaurantList</div>;
};

export default RestaurantList;
